import Header from "./components/Header/index.js";
import Posts from "./components/Posts/index.js";
import Footer from "./components/Footer/index.js";
import Form from "./components/Form/index.js";
import { useState } from "react";
import uuid from "react-uuid";

export default function App() {
  // Add a new post
  const initialPosts = [
    {
      id: uuid(),
      title: "The White Mountain",
      content:
        "The White Mountains are a mountain range covering about a quarter of the state of New Hampshire and a small portion of western Maine in the United States.",
      category: "ent",
      promote: true,
      status: "pub",
      // Alt + Z to wrap the text
      // picture:
      //  "data:image/jpeg;base64,",
      likes: 8,
      dislikes: 16,
    },
    {
      id: uuid(),
      title: "The Great Wall of China",
      content:
        "The Great Wall of China is a series of fortifications made of stone, brick, tamped earth, wood, and other materials, generally built along an east-to-west line across the historical northern borders of China to protect the Chinese states and empires against the raids and invasions of the various nomadic groups of the Eurasian Steppe.",
      category: "edu",
      promote: false,
      status: "arc",
      // picture:
      //  "data:image/jpeg;base64,",
      likes: 32,
      dislikes: 8,
    },
    {
      id: uuid(),
      title: "The Great Pyramid of Giza",
      content:
        "The Great Pyramid of Giza (also known as the Pyramid of Khufu or the Pyramid of Cheops) is the oldest and largest of the three pyramids in the Giza pyramid complex bordering present-day Giza in Greater Cairo, Egypt.",
      category: "nws",
      promote: true,
      status: "arc",
      /* picture:
        "data:image/jpeg;base64,",
      */
      likes: 28,
      dislikes: 6,
    },
    {
      id: uuid(),
      title: "The Great Barrier Reef",
      content:
        "The Great Barrier Reef is the world's largest coral reef system composed of over 2,900 individual reefs and 900 islands stretching for over 2,300 kilometers (1,400 miles) over an area of approximately 344,400 square kilometers (133,000 square miles).",
      category: "edu",
      promote: false,
      status: "drf",
      // picture:
      // "data:image/jpeg;base64,",
      likes: 6,
      dislikes: 13,
    },
  ];

  const [posts, setPosts] = useState(initialPosts);

  const handleAddPost = (
    title,
    content,
    category,
    promote,
    status,
    picture
  ) => {
    posts.push({
      id: uuid(),
      title,
      content,
      category,
      promote,
      status,
      picture,
      likes: 0,
      dislikes: 0,
    });
    setPosts([...posts]);
  };

  // Update the number of likes
  const handlePostLike = (id) => {
    const updatedPosts = posts.map((post) => {
      if (post.id === id) {
        return {
          ...post,
          likes: post.likes + 1,
        };
      }
      return post;
    });
    setPosts(updatedPosts);
  };

  // Update the number of dislikes
  const handlePostDislike = (id) => {
    const updatedPosts = posts.map((post) => {
      if (post.id === id) {
        return {
          ...post,
          dislikes: post.dislikes + 1,
        };
      }
      return post;
    });
    setPosts(updatedPosts);
  };

  return (
    <>
      <Header />

      <Posts
        posts={posts}
        onPostLike={handlePostLike}
        onPostDislike={handlePostDislike}
      />
      <Form onAddPost={handleAddPost} />
      <Footer />
    </>
  );
}
